import React from "react";

const Product = props => {
  return (
    <div data-type={props.productType} data-price={props.productPrice} class="col-md-4 sortClass">
      {/* <!-- Card --> */}
      <div class="card">
        {/* <!-- Card image --> */}
        <div class="view overlay">
          <img class="card-img-top" src={props.productImage} alt={props.productImageAlt} />
          <a href="#!">
            <div class="mask rgba-white-slight" />
          </a>
        </div>

        {/* <!-- Card content --> */}
        <div class="card-body">
          {/* <!-- Title --> */}
          <h4 class="card-title">{props.productName}</h4>
          {/* <!-- Text --> */}
          <p class="card-text">${props.productPrice}</p>
          {/* <!-- Button --> */}
          <p class="card-text">{props.productDescription}</p>
          <a href="##" class="btn btn-primary">
            Order Now!
          </a>
        </div>
      </div>
      {/* <!-- Card --> */}
    </div>
  );
};

export default Product;
